import axios from "axios";

const World =  async () => {
    const rec = await axios({
        "method":"GET",
        "url":"https://corona.lmao.ninja/countries",
        "params":{
        "sort":"cases"
        }
        })
    .then((response)=>{
        const Timeline = response.data;
        return Timeline;
    })
    .catch((error)=>{
        console.log(error)
});
return rec;
}

export default World;
